	$OnLoadFormEvent = {
		$cursor = $MainForm.Cursor
		$MainForm.Cursor = [System.Windows.Forms.Cursors]::WaitCursor
		$progressbaroverlay.Visible = $true
		$progressbaroverlay.TextOverlay = "Retrieving subscriptions"
		$progressbaroverlay.Value = 50
		try {
			Import-Module Azure -ErrorAction Stop
			Retrieve-AzureSubscription
			Load-ComboBox $comboboxSubscription -Items $listSubs
			$progressbaroverlay.TextOverlay = "Subscriptions loaded"
			$progressbaroverlay.Value = 100
		} catch [System.IO.FileNotFoundException] {
			$progressbaroverlay.TextOverlay = "Cannot find Azure PowerShell Module"
			$progressbaroverlay.Value = 100
			$groupboxAzureIaaS.Visible = $false
			$labelSelectSubscription.Visible = $false
			$comboboxSubscription.Visible = $false
			$buttonAddAzureAccount.Visible = $false
			$linklabelDownloadSDKWarning.Visible = $true
		} catch {
			$progressbaroverlay.TextOverlay = "No subscriptions loaded"
			$progressbaroverlay.Value = 100
		}
		$MainForm.Cursor = $cursor
	}
	
	#region Control Helper Functions
	function Load-ComboBox 
	{
	<#
		.SYNOPSIS
			This functions helps you load items into a ComboBox.
	
		.DESCRIPTION
			Use this function to dynamically load items into the ComboBox control.
	
		.PARAMETER  ComboBox
			The ComboBox control you want to add items to.
	
		.PARAMETER  Items
			The object or objects you wish to load into the ComboBox's Items collection.
	
		.PARAMETER  DisplayMember
			Indicates the property to display for the items in this control.
		
		.PARAMETER  Append
			Adds the item(s) to the ComboBox without clearing the Items collection.
		
		.EXAMPLE
			Load-ComboBox $combobox1 "Red", "White", "Blue"
		
		.EXAMPLE
			Load-ComboBox $combobox1 "Red" -Append
			Load-ComboBox $combobox1 "White" -Append
			Load-ComboBox $combobox1 "Blue" -Append
		
		.EXAMPLE
			Load-ComboBox $combobox1 (Get-Process) "ProcessName"
	#>
		Param (
			[ValidateNotNull()]
			[Parameter(Mandatory=$true)]
			[System.Windows.Forms.ComboBox]$ComboBox,
			[ValidateNotNull()]
			[Parameter(Mandatory=$true)]
			$Items,
		    [Parameter(Mandatory=$false)]
			[string]$DisplayMember,
			[switch]$Append
		)
		
		if(-not $Append)
		{
			$ComboBox.Items.Clear()	
		}
		
		if($Items -is [Object[]])
		{
			$ComboBox.Items.AddRange($Items)
		}
		elseif ($Items -is [Array])
		{
			$ComboBox.BeginUpdate()
			foreach($obj in $Items)
			{
				$ComboBox.Items.Add($obj)	
			}
			$ComboBox.EndUpdate()
		}
		else
		{
			$ComboBox.Items.Add($Items)	
		}
	
		$ComboBox.DisplayMember = $DisplayMember	
	}
	#endregion
	
	$comboboxSubscription_SelectedIndexChanged = {
		$labelErrorAzureSub.Visible = $false
		$groupboxAzureIaaS.Visible = $true
		$labelSelectSubscription.Visible = $true
		$comboboxSubscription.Visible = $true
		$sub = $comboboxSubscription.Text
		$cursor = $MainForm.Cursor
		$progressbaroverlay.Visible = $true
		$progressbaroverlay.TextOverlay = "Getting data for $sub"
		$progressbaroverlay.Value = 50
		$MainForm.Cursor = [System.Windows.Forms.Cursors]::WaitCursor
		Get-AzureSubscription -SubscriptionName $sub | select-AzureSubscription
		try {
			$cloudService = Get-AzureService | Select-Object -ExpandProperty ServiceName
			$cloudNetworks = Get-AzureVNetSite | Select-Object -ExpandProperty Name
			#$cloudSubnets = Get-AzureVNetSite | Select-Object -ExpandProperty Subnets | Select-Object -expandproperty Name
			$azureRegions = Get-AzureLocation | Select-Object -ExpandProperty Name
			$azureNsg = Get-AzureNetworkSecurityGroup | Select-Object -ExpandProperty Name
			if ($azureNsg -ne $null) {
				Load-ComboBox -ComboBox $comboboxNSGName -Items $azureNsg
			}		
			if ($cloudService -ne $null) {
				Load-ComboBox $comboboxCloudService -Items $cloudService
			}
			if ($cloudNetworks -ne $null) {
				Load-ComboBox $comboboxNetwork -Items $cloudNetworks
			}
	#		if ($cloudSubnets -ne $null) {
	#			Load-ComboBox $comboboxILBSubnet -Items $cloudSubnets
	#			Load-ComboBox $comboboxNetwork -Items $cloudSubnets
	#		}
			Load-ComboBox -ComboBox $comboboxNSGRegion -Items $azureRegions
			
		} catch [exception] {
			Write-Host -ForegroundColor 'Yellow' $Error[0]
			$progressbaroverlay.Visible = $false
			$groupboxAzureIaaS.Visible = $false
			$labelErrorAzureSub.Visible = $true
