	#--------------------------------------------
	# Declare Global Variables and Functions here
	#--------------------------------------------
	function Retrieve-AzureSubscription {
		$global:listSubs = Get-AzureSubscription | Select-Object -ExpandProperty SubscriptionName
	}
	
	function Retrieve-AzureVM {
		param
		(
			[parameter(Mandatory = $true)]
			[string]
			$cloudService,
		
			[parameter(Mandatory = $false)]
			[string]
			$vmName
		)
		Get-AzureVM -Name $vmName -ServiceName $cloudService
	}
	
	function Get-VMStatus {
		$azureVM = Retrieve-AzureVM -cloudService $comboboxCloudService.Text -vmName $comboboxAzureVM.Text
		$textboxVMAvailSet.Text = $azureVM.AvailabilitySetName
		$textboxVMDeployName.Text = $azureVM.DeploymentName
		$textboxVMDNSName.Text = $azureVM.DNSName
		$textboxVMFaultDomain.Text = $azureVM.InstanceFaultDomain
		$textboxVMHostName.Text = $azureVM.HostName
		$textboxVMIP.Text = $azureVM.IpAddress
		$textboxVMName.Text = $azureVM.Name
		$textboxVMPowerstate.Text = $azureVM.PowerState
		$textboxVMRoleState.Text = $azureVM.InstanceStatus
		$textboxVMSize.Text = $azureVM.InstanceSize
		$textboxVMStatus.Text = $azureVM.Status
		$textboxVMUpgradeDomain.Text = $azureVM.InstanceUpgradeDomain
	}
	
	function Update-NsgAclGrid {
		$NsgAclInbound = Get-AzureNetworkSecurityGroup -Name $azureNsgAcl -Detailed | Select-Object -ExpandProperty rules | Where-Object type -EQ "Inbound" | Select-Object Priority, Name, Type, Protocol, Action, SourceAddressPrefix, SourcePortRange, DestinationAddressPrefix, DestinationPortRange
		$AclInboundTable = ConvertTo-DataTable -InputObject $NsgAclInbound
		Load-DataGridView -DataGridView $datagridviewNSGACLInbound -Item $AclInboundTable
		
		$NsgAclOutbound = Get-AzureNetworkSecurityGroup -Name $azureNsgAcl -Detailed | Select-Object -ExpandProperty rules | Where-Object type -EQ "Outbound" | Select-Object Priority, Name, Type, Protocol, Action, SourceAddressPrefix, SourcePortRange, DestinationAddressPrefix, DestinationPortRange
		$AclOutboundTable = ConvertTo-DataTable -InputObject $NsgAclOutbound
		Load-DataGridView -DataGridView $datagridviewNSGACLOutbound -Item $AclOutboundTable	
	}
	
	#Sample function that provides the location of the script
	function Get-ScriptDirectory
	{
	<#
		.SYNOPSIS
			Get-ScriptDirectory returns the proper location of the script.
	
		.OUTPUTS
			System.String
		
		.NOTES
			Returns the correct path within a packaged executable.
	#>
		[OutputType([string])]
		param ()
		if ($hostinvocation -ne $null)
		{
			Split-Path $hostinvocation.MyCommand.path
		}
		else
		{
			Split-Path $script:MyInvocation.MyCommand.Path
		}
	}
	
	#Sample variable that provides the location of the script
	[string]$ScriptDirectory = Get-ScriptDirectory
	
	
