	}
	
	$buttonExit_Click = {
		$formAzureEndpoints.Close()
	}
	
	$datagridviewResults_ColumnHeaderMouseClick = [System.Windows.Forms.DataGridViewCellMouseEventHandler]{
		#Event Argument: $_ = [System.Windows.Forms.DataGridViewCellMouseEventArgs]
		if ($datagridviewResults.DataSource -is [System.Data.DataTable]) {
			$column = $datagridviewResults.Columns[$_.ColumnIndex]
			$direction = [System.ComponentModel.ListSortDirection]::Ascending
			
			if ($column.HeaderCell.SortGlyphDirection -eq 'Descending') {
				$direction = [System.ComponentModel.ListSortDirection]::Descending
			}
			
			$datagridviewResults.Sort($datagridviewResults.Columns[$_.ColumnIndex], $direction)
		}
	}
	
	$buttonDelete_Click={
		$progressbaroverlayEndPoint.Visible = $true
		$progressbaroverlayEndPoint.Value = 50
		$progressbaroverlayEndPoint.TextOverlay = "Deleting Azure Endpoint"
		$selectedRow = $datagridviewResults.CurrentRow
		$azureEndpointName = $selectedRow.DataBoundItem.Name
		$azureVM = Get-AzureVM -Name $vmName -ServiceName $cloudService
		Remove-AzureEndpoint -Name $azureEndpointName -VM $azureVM | Update-AzureVM
		$endPoints = Get-AzureEndpoint -VM $azureVM | Select-Object Name, LocalPort, Port, Protocol, LBSetName, ProbeProtocol, ProbePort, ProbePath, EnableDirectServerReturn, InternalLoadBalancerName
		Load-DataGridView -DataGridView $datagridviewResults -Item $endPoints
		$progressbaroverlayEndPoint.Value = 100
		$progressbaroverlayEndPoint.TextOverlay = "Endpoint Deleted!"
	}
	
	$buttonManageACL_Click = {
		$progressbaroverlayEndPoint.Visible = $false
		$selectedRow = $datagridviewResults.CurrentRow
		$azureEndpointName = $selectedRow.DataBoundItem.Name
		Call-azureEndpointACL_psf -cloudService $cloudService -vmName $vmName -endpointName $azureEndpointName
	}
	
