	$buttonAddEPACL_Click = {
		$buttonUpdateList.Visible = $false
		$cursor = $MainForm.Cursor
		$progressbaroverlayEPACLRule.Visible = $true
		$progressbaroverlayEPACLRule.Value = 50
		$progressbaroverlayEPACLRule.TextOverlay = "Adding rule"
		$MainForm.Cursor = [System.Windows.Forms.Cursors]::WaitCursor
		$azureVM = Get-AzureVM -Name $vmName -ServiceName $cloudService
		$epACL = $azureVM | Get-AzureAclConfig -EndpointName $endpointName
		
		$selectedRow = $datagridviewResults.CurrentRow
		$azureLBSetName = $selectedRow.DataBoundItem.LBSetName
		$azureLBProbeProtocol = $selectedRow.DataBoundItem.ProbeProtocol
		$azureLBProbePath = $selectedRow.DataBoundItem.ProbePath
		
		try {
			Set-AzureAclConfig –AddRule –ACL $epACL –Order $textboxEPACLOrder.Text –Action $comboboxEPACLAction.Text –RemoteSubnet $textboxEPACLRemoteSubnet.Text –Description $textboxEPACLDescription.Text
			if ($azureLBSetName -eq $null) {
				$azureVM | Set-AzureEndpoint -Name $endpointName -ACL $epACL -ErrorAction Stop | Update-AzureVM -ErrorAction Stop
			} else {
				if ($azureLBProbeProtocol -eq "HTTP") {
					Set-AzureLoadBalancedEndpoint -ServiceName $cloudService -LBSetName $azureLBSetName -ProbeProtocolHTTP -ProbePath $azureLBProbePath -ACL $epACL
				} else {
					Set-AzureLoadBalancedEndpoint -ServiceName $cloudService -LBSetName $azureLBSetName -ProbeProtocolTCP -ACL $epACL
				}
			}
			$epACL = $azureVM | Get-AzureAclConfig -EndpointName $endpointName
			$table = ConvertTo-DataTable -InputObject $epACL
			try {
				Load-DataGridView -DataGridView $datagridviewEPACL -Item $table
			} catch [exception] {
				Write-Host -ForegroundColor 'Cyan' "Update list to see added entry"
			}
			$progressbaroverlayEPACLRule.Value = 100
			$progressbaroverlayEPACLRule.TextOverlay = "Rule added"
		} catch [exception] {
			$progressbaroverlayEPACLRule.Visible = $false
			$Error[0]
		}
		Start-Sleep -Seconds 2
		$progressbaroverlayEPACLRule.Visible = $false
		$progressbaroverlayEPACLRule.TextOverlay = ""
		$buttonUpdateList.Visible = $true
		$MainForm.Cursor = $cursor
		
	}
	
